import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import Form from "./Form.js";


function App() {
  const [submitting, setSubmitting] = userState(false);

  const handelSubmit = event => {
    event.preventDefault();
    setSubmitting(true);
    alert('Takk for din bestilling')
    setTimeout(() => {
      setSubmitting(false);
    }, 3000)
  }

  return (
   <div className="App">
    <div className="App-header">
     <img src={logo} className="App-logo" alt="logo" />
    </div>
    <div className="Wrapper">
     <h1>Bestilling skjema</h1>
     <form className="User-Form" onSubmit={handelSubmit}>
      <div className="Fieldset">
       <label>Fornavn:
        <input id="firstName" />
        </label>
        <label>Etternavn:
        <input id="surName" />
        </label>
      </div>

      <div className="Fieldset">
      <label>
        Epost:
        <input id="email" />
        </label>
      <label>Telefon nummer:
        <input id="phoneNr" />
        </label>
      </div>

      <div className="Fieldset">
      <label>Gatenavn:
        <input id="adress" />
        </label>
        <label>Post nummer:
        <input id="zip" />
        </label>
      </div>

      <div className="Fieldset">
        <button type="submit">Send</button>
      </div>
     </form>
    </div>
   </div>
  );
 }


export default App;
